import PremiumSingleCard from "./PremiumSingleCard";


const PremiumCards = () => {
    return(
        <>
        <div className="premium-cards-block">
            <PremiumSingleCard time="1 Месяц" colorTime="#000" priceTotal="199руб" color="#EC9A29" margin="2em" btnColor="linear-gradient(to right, #fff, #fff, #fff, #fff)" btnBorder="2px solid #EC9A29" shadow="1px 1px 10px 3px #EC9A29"/>
            <PremiumSingleCard time="3 Месяца" colorTime="#66D9A2" priceMonth="169 руб/мес" priceTotal="199руб" color="#fff" btnColor="linear-gradient(to right, #66D9A2, #fff, #fff, #66D9A2)" btnBorder="2px solid #66D9A2" shadow="1px 1px 10px 3px #66D9A2"/>
            <PremiumSingleCard time="6 Месяцев" colorTime="#66D9A2" priceMonth="149 руб/мес" priceTotal="849руб" color="#fff"/>
            <PremiumSingleCard time="1 Год" colorTime="#66D9A2" priceMonth="129 руб/мес" priceTotal="1548руб" color="#fff"/>
        </div>
        </>
        // style={{backgroundImage: "linear-gradient(to right, #fff, #fff, #fff, #fff)", border: "2px solid #EC9A29"}}
    )
}

export default PremiumCards;
